import { FormControl, InputLabel, MenuItem, Select, TextField, FormHelperText } from "@material-ui/core";
import React, { useState } from "react";
import { REGION_LIST } from '../Map/REGION_LIST.js'
import  { useFormControl } from '@mui/material/FormControl';


function MyFormHelperText() {
    const { focused } = useFormControl() || {};

    const helperText = React.useMemo(() => {
        if (focused) {
            return 'This field is being focused';
        }

        return 'Helper text';
    }, [focused]);

    return <FormHelperText>{helperText}</FormHelperText>;
}

export default function UserForm() {
    return (
        <div className="row justify-content-center">
            <header >
                <div className="row justify-content-center">
                    <div className="col-lg-auto">
                        <h2 className='text-violet text-5xl mb-4'>
                            регистрация </h2>
                        <p className='text-violet'>Принять участие в розыгрыше могут только лица, достигшие 18 лет</p>
                    </div>
                </div>
                <form
                    className='mt-8'
                // onSubmit={handleSubmit(onSubmit)}
                >
                    <div className="grid grid-cols-2 gap-4">
                        <div className="w-full">
                            <FormControl sx={{ width: '25ch' }}>

                                <TextField
                                    className="w-full"
                                    id="first_name"
                                    name="first_name"
                                    label="Имя"
                                    variant="outlined"
                                    // error={errors.first_name}
                                    // value={values.first_name}
                                    // helperText={errors.first_name && errors.first_name.message}
                                    // {...register("first_name", {
                                    //     required: true,
                                    //     pattern: {
                                    //         value: /[А-ЯЁA-Z]{2,15}/i,
                                    //         message: 'Только буквы и пробел'
                                    //     }
                                    // })}
                                    // onChange={handleChange}
                                />
                                <MyFormHelperText />
                            </FormControl>
                        </div>
                        <div className="w-full">
                            <TextField
                                className="w-full"
                                id="last_name"
                                name="last_name"
                                label="Фамилия"
                                variant="outlined"
                                error={errors.last_name}
                                value={values.last_name}
                                helperText={errors.last_name && errors.last_name.message}
                                {...register("last_name", {
                                    required: 'Обязательно',
                                    pattern: {
                                        value: /[А-ЯЁA-Z]{2,15}/i,
                                        message: 'Только буквы и пробел'
                                    }
                                })}
                                onChange={handleChange}
                            />
                        </div>
                        <div className="w-full">
                            <TextField
                                label="E-mail"
                                id="email"
                                value={values.email}
                                variant="outlined"
                                error={errors.email}
                                helperText={errors.email && errors.email.message}
                                {...register("email", {
                                    required: 'Обязательно',
                                    pattern: {
                                        value: /^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,}$/i,
                                        message: 'Неправильный адрес электронной почты'
                                    }
                                })}
                                onChange={handleChange}
                            />
                        </div>
                        <div className="w-full">
                            <input
                                // required
                                type="number"
                                className=" w-full "
                                name="user_age" id="user_age"
                                placeholder="Возраст"
                            // value={birth && birth}
                            // onChange={(e) => { this.changeData(e, 'birth') }}
                            />
                        </div>
                        <div className="w-full">
                            {/* <FormControl variant="outlined">
                                <InputLabel htmlFor="outlined-age-native-simple">
                                    Выберите регион
                                </InputLabel>
                                <Select
                                    labelId="demo-customized-select-label"
                                    id="demo-customized-select"
                                    // value={region}
                                    // onChange={(e) => { this.changeData(e, 'region') }}
                                    label="Выберите регион"
                                    inputProps={{
                                        name: "Выберите регион  ",
                                        id: "outlined-age-native-simple",
                                    }}
                                >
                                    {REGION_LIST.map((item, index) => (
                                        <MenuItem value={item.city} key={index}>{item.city}</MenuItem>
                                    ))}
                                </Select>
                            </FormControl> */}
                        </div>
                        <div className="w-full file relative">
                            <input
                                // required
                                type="file"
                                className=" w-full "
                                name="user_file" id="user_file"
                                placeholder="Возраст"
                            // value={birth && birth}
                            // onChange={(e) => { this.changeData(e, 'birth') }}
                            />
                            <label htmlFor="user_file" className='w-full'>Загрузить фото коробки с яйцами
                                <div className="btn lil-btn">+</div>
                            </label>
                        </div>

                    </div>
                    {/* {!confirmedRules && */}
                    <div className="row justify-content-center">
                        <div className="col-lg-auto">
                            <div className="row politics">
                                <input
                                    type="checkbox"
                                    name="user_accept"
                                    id="user_accept"
                                    required
                                />
                                <label htmlFor="user_accept" className="check-box"></label>
                                <p>Я согласен с{' '}
                                    <a
                                        className="btnLink orange"
                                        href="https://dixy.ru/politika-obrabotki-i-zashity.pdf"
                                        target="_blank">Политикой Конфиденциальности и обработки моих данных</a>, ознакомлен с правилами акции.
                                </p>
                            </div>
                        </div>
                    </div>
                    {/* } */}
                    {/* {systemMessage && <div className="col-lg-auto systemMessage mt-4 text-center">{systemMessage}</div>} */}
                    <div className="mx-auto" style={{ width: 'fit-content', display: 'grid' }}>
                        <button className='btn grid mt-8 py-4 px-8'>
                            <span>сохранить</span>
                        </button>

                    </div>
                </form>
            </header>
        </div>
    )

}
